import styled from 'styled-components'

export const Landing = styled.div`
  display: grid;
  padding: 75px 200px 175px;
`
const Button = styled.button`
  background: transparent;
  border-radius: 3px;
  border: 2px solid palevioletred;
  color: palevioletred;
  margin: 0 1em;
  padding: 0.25em 1em;
`
